package dev.alex.leetcode.solution;

import org.junit.Assert;
import org.junit.Before;
import org.junit.Test;

public class _567Test {
    private _567 instance;

    @Before
    public void setUp() throws Exception {
        instance = new _567();
    }

    @Test
    public void checkInclusion() {
        System.out.println("case 1:");
        Assert.assertTrue(instance.checkInclusion("ab", "eidbaooo"));
        System.out.println("case 2:");
        Assert.assertFalse(instance.checkInclusion("ab", "eidboaoo"));
        System.out.println("case 3:");
        Assert.assertTrue(instance.checkInclusion("adc", "dcda"));
        System.out.println("case 4:");
        Assert.assertFalse(instance.checkInclusion("ab", "eidboaoo"));
        System.out.println("case 5:");
        Assert.assertTrue(instance.checkInclusion("", ""));
        System.out.println("case 6:");
        Assert.assertTrue(instance.checkInclusion("ab", "ab"));
        System.out.println("case 7:");
        Assert.assertFalse(instance.checkInclusion("hello", "ooolleoooleh"));
    }
}